import React, { Component } from 'react';
import Styles from './ContatoRow.css';

import {
	View,
	Text,
	Image,
	TouchableHighlight
} from 'react-native';

export default class ContatoRow extends Component{

	foto(){
		const { contato } = this.props;

		if(contato.foto.uri === null){
			contato.foto.uri = 'data:image/jpeg;base64,';
			//return null
		}

		return <TouchableHighlight>
			<Image
				style={Styles.image}
				source={contato.foto}
				resizeMode="cover"
			/>
		</TouchableHighlight>
	}

	render(){
		const { contato } = this.props;

		return (
			<View style={Styles.container}>
				{ this.foto() }
				<Text style={Styles.name}>{ contato.nome }</Text>
			</View>
		);
	}
}

